def _get_with(self, key):
    if isinstance(key, slice):
        slobj = self.index._convert_slice_indexer(key, kind="getitem")
        return self._slice(slobj)
    elif isinstance(key, ABCDataFrame):
        raise TypeError(
            "Indexing a Series with DataFrame is not "
            "supported, use the appropriate DataFrame column"
        )
    elif isinstance(key, tuple):
        return self._get_values_tuple(key)

    elif isinstance(key, (np.ndarray, list, Index, Series)):
        if is_categorical_dtype(key):
            key = key.astype("object")

        key_type = key.inferred_type if isinstance(key, Index) else lib.infer_dtype(key, skipna=False)

        if key_type == "boolean":
            key = ensure_platform_int(key)

        if key_type in ["integer", "boolean", "string", "mixed"]:
            indexer = self.index._get_indexer(key)
            return self._take(indexer)

    return self.reindex(key)
